montageDefine("daa4856","vendor/requirejs/tests/simple-nohead.html",{text:'<!DOCTYPE html><html><head></head><body><h1>require.js: Simple Test, no head tag</h1>\n<p>Check console for messages</p>\n\n<script>\nvar require = {\n    baseUrl: "./"\n};\n</script>\n<script src=../require.js></script>\n<script src=doh/runner.js></script>\n<script src=doh/_browserRunner.js></script>\n<script>\nrequire(["require", "simple", "dimple", "func"],\n    function(require, simple, dimple, func) {\n        doh.register(\n            "simple-nohead", \n            [\n                function colors(t){\n                    t.is("blue", simple.color);\n                    t.is("dimple-blue", dimple.color);\n                    t.is("You called a function", func());\n                }\n            ]\n        );\n        doh.run();\n    }\n);\n</script>\n</body></html>'});